space: normal; background-color: rgb(255, 255, 255);">强劲四核处理器</h4><p class="kmd-text-paragraph-body " style="font-family: Verdana; font-size: 14px; line-height: 19px; margin-top: 0px; margin-bottom: 20px; white-space: normal; background-color: rgb(255, 255, 255);">Kindle Fire HDX平板电脑具备高通骁龙800四核2.2 GHz处理器、2GB的内存，强劲任务处理，多媒体运行更流畅。</p><h4 class="kmd-paragraph-title" style="font-family: Arial; font-weight: normal; margin: 0px 0px 5px; font-size: 20px; color: rgb(228, 121, 17); white-space: normal; background-color: rgb(255, 255, 255);">超凡的图像品质</h4><p class="kmd-text-paragraph-body " style="font-family: Verdana; font-size: 14px; line-height: 19px; margin-top: 0px; margin-bottom: 20px; white-space: normal; background-color: rgb(255, 255, 255);">Kindle Fire HDX平板电脑采用全新的Adreno 330显卡，具有高帧率和超凡的图形处理能力。</p><h4 class="kmd-paragraph-title" style="font-family: Arial; font-weight: normal; margin: 0px 0px 5px; font-size: 20px; color: rgb(228, 121, 17); white-space: normal; background-color: rgb(255, 255, 255);">杜比音频</h4><p class="kmd-text-paragraph-body " style="font-family: Verdana; font-size: 14px; line-height: 19px; margin-top: 0px; margin-bottom: 20px; white-space: normal; background-color: rgb(255, 255, 255);">Kindle Fire平板电脑采用杜比数字+(Dolby Digital Plus )技术创造出世界级的聆听感受。杜比数字+技术包括音量调节、虚拟环绕声、以及视频对白声增强。无论您是看电影、听音乐还是进行视频通话，Kindle Fire平板电脑都会根据您在运行的程序以及是否使用耳机来自动优化音频。</p><h4 class="kmd-paragraph-title" style="font-family: Arial; font-weight: normal; margin: 0px 0px 5px; font-size: 20px; color: rgb(228, 121, 17); white-space: normal; background-color: rgb(255, 255, 255);">超长电池续航时间</h4><p class="kmd-text-paragraph-body " style="font-family: Verdana; font-size: 14px; line-height: 19px; margin-top: 0px; margin-bottom: 20px; white-space: normal; background-color: rgb(255, 255, 255);">Kindle Fire HDX平板电脑拥有先进的电源管理技术，可提供长达11小时的阅读、上网、视频观看或音乐播放。若只是用于阅读，Kindle Fire HDX平板电脑还会自动开启省电模式，使电池续航时间延至长达17小时。</p><h4 class="kmd-paragraph-title" style="font-family: Arial; font-weight: normal; margin: 0px 0px 5px; font-size: 20px; color: rgb(228, 121, 17); white-space: normal; background-color: rgb(255, 255, 255);">疾速WiFi连接</h4><p class="kmd-text-paragraph-body kmd-paragraph-last" style="font-family: Verdana; font-size: 14px; margin-top: 0px; margin-bottom: 20px; line-height: 19px; white-space: normal; background-color: rgb(255, 255, 255);">Kindle Fire HDX平板电脑采用先进的双频段双天线WiFi，您可以尽情享受流畅游戏视频。</p><p class="kmd-text-paragraph-body kmd-paragraph-last" style="font-family: Verdana; font-size: 14px; margin-top: 0px; margin-bottom: 20px; line-height: 19px; white-space: normal; background-color: rgb(255, 255, 255);"><img src="http://www.1ykxm.com/statics/uploads/shopimg/20140414/73903749452830.jpg" title="feature-hdx._V343285301_.jpg"/></p><p>HDX超高清屏幕拥有卓越的分辨率(1920x1200)和像素密度(323 ppi)、100%sRGB色域还原、更高亮度、低反光，使画面栩栩如生。</p><table class="kmd-section-text-body" style="border-collapse: collapse; font-family: verdana, arial, helvetica, sans-serif; background-color: rgb(255, 255, 255);"><tbody><tr><td class="kmd-standard-padding " style="font-size: small; padding: 40px 40px 0px 0px; vertical-align: top; width: 644px;"><h4 class="kmd-paragraph-title" style="font-family: Arial; font-weight: normal; margin: 0px 0px 5px; font-size: 20px; color: rgb(228, 121, 17);">世界领先的HDX超高清显示屏</h4><p class="kmd-text-paragraph-body " style="font-family: Verdana; font-size: 14px; line-height: 19px; margin-top: 0px; margin-bottom: 20px;">Kindle Fire HDX平板电脑拥有极高分辨率(1920x1200)和像素密度(323ppi)，带给您无与伦比的多媒体体验。超过200万像素的HDX超高清显示屏，生动逼真的影像大幅超越标准高清屏。</p><h4 class="kmd-paragraph-title" style="font-family: Arial; font-weight: normal; margin: 0px 0px 5px; font-size: 20px; color: rgb(228, 121, 17);">绚丽本色</h4><p class="kmd-text-paragraph-body kmd-paragraph-last" style="font-family: Verdana; font-size: 14px; margin-top: 0px; margin-bottom: 20px; line-height: 19px;">HDX超清显示屏拥有100%sRGB色域还原，自然逼真的图像达到专业摄影摄像师要求标准。</p><p class="kmd-text-paragraph-body kmd-paragraph-last" style="font-family: Verdana; font-size: 14px; margin-top: 0px; margin-b